import './App.css';
import {useState, useEffect} from 'react';
import './css/styles.css'
import { Route, Routes } from 'react-router-dom';
import AppRoutes from './AppRoutes';


function App() {

  const [name, setName ] = useState('')

  useEffect(() =>
  {
    fetch('http://127.0.0.1:5001/')
        .then(response => response.json())
        .then(response => console.log(response));
  }, []);


  const Navigation = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
            <div className="container px-4 px-lg-5">
                <a className="navbar-brand" href="#page-top">GHG</a>
                <button className="navbar-toggler navbar-toggler-right" type="button" data-bs-toggle="collapse" data-bs-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation"><span className="navbar-toggler-icon"></span></button>
                <div className="collapse navbar-collapse" id="navbarResponsive">
                    <ul className="navbar-nav ms-auto my-2 my-lg-0">
                        <li className="nav-item"><a className="nav-link" href="#about">Home</a></li>
                        <li className="nav-item"><a className="nav-link" href="#services">Calculator</a></li>
                        <li className="nav-item"><a className="nav-link" href="#portfolio">Knowledge</a></li>
                        <li className="nav-item"><a className="nav-link" href="#contact">Contact</a></li>
                    </ul>
                </div>
            </div>
        </nav>
    );
    }


    const Header = () => {
      return (
          <header className="masthead">
              <div className="container px-4 px-lg-5 h-100">
                  <div className="row gx-4 gx-lg-5 h-100 align-items-center justify-content-center text-center">
                      <div className="col-lg-8 align-self-end">
                          <h1 className="text-white font-weight-bold">Your Favorite Place for Free Bootstrap Themes</h1>
                          <hr className="divider" />
                      </div>
                      <div className="col-lg-8 align-self-baseline">
                          <p className="text-white-75 mb-5">Start Bootstrap can help you build better websites using the Bootstrap framework! Just download a theme and start customizing, no strings attached!</p>
                          <a className="btn btn-primary btn-xl" href="#about">Find Out More</a>
                      </div>
                  </div>
              </div>
          </header>
      );
  }


  return (
    <div className="App">
      <Navigation />
      <Header />
      <Router>  
      <Routes>
        {AppRoutes.map((route, index) => {
          const { element, ...rest } = route;
          return <Route key={index} {...rest} element={element} />;
        })}
      </Routes>
      </Router>
    </div>
  );
}

export default App;
